import React from 'react'
import '../style/Video.css';
import Stream from './Stream';

export default class VideoPage extends React.Component {
    componentDidMount(){
        fetch("/")
          .then((res) => res.json())
          .then((data) => this.setState({createSession:data.createSession}))
          .catch((err) => {
            console.error('Loading', err);
            alert('Loading');
          });

      }

    constructor(props) {
    super(props);


    this.state = {
        createSession:false,
    };
    }
    render(){
        return(
            <div className="Video">
                <h2> VIDEO </h2>
                <form action="http://localhost:3001/" method ="GET">
                    <input type="submit" value=" Create Session"></input>
                </form>
                {this.createSession !== false &&
                <Stream />
                }
            </div>
        );
    };
};
